Explainee: And there's constantly novel UX innovations. Like Google Earth, where the kind of elimination of your periphery as you zoom in and move. And also, giving you the user action to decide where you're going and looking. I'm constantly seeing people coming up with ways to break from the paradigms of actual reality and then introduce mechanisms that work very well.
