Explainer: So do you think there's some sense in which we shouldn't be thinking about individual universes, individual space-time, so we should be thinking about superpositions of space-times?
Explainee: Yeah, I think so. I think if you were to go far enough back in the history of the universe, back to when it was very, very dense, very small, and when quantum mechanics was certainly important, then it must have been like that. I mean, if we believe that the dominant standard model of cosmology, something had to produce the density perturbations, the things that seeded all the galaxies and stars and everything else in the world. So there's a galaxy over there, let's say, and not over there, so how did that happen? Why is there a galaxy there and not there? In the standard theory, as you know, that was a quantum event, a random event. And it doesn't mean that if happened there and not there 'cause you flipped a coin, it actually happened in both places. There's gotta be a wave function where in one branch of the wave function there's a galaxy there and not there, and on the other branch it's the opposite.
