Explainee: Sure, yeah, it is a beautiful, beautiful idea. So, first of all, to be totally clear, though, we've never observed Hawking radiation, which is what he predicted, directly. I don't think very many people doubt that it's there, but yeah, Hawking discovered mathematically that when you have a black hole, it's got an event horizon, it's got a surface which is a point of no return. If you fall through that surface, no matter what you have, no matter how powerful the rocket you've got, even if you beam a flashlight back behind you in the direction you fall from, nothing escapes, not even light. It all gets sucked in and spaghettified and destroyed at the singularity, or something, something happens, but it doesn't get out. But in quantum mechanics, you can't really pin down the location of something precisely. If you try to pin down an electron in a tiny circuit in a microchip, sometimes you discover it's not actually there and then your computer crashes.
