Explainee: We work on something called bacteriophages, it's a virus with DNA. This particular bacteriophage called M13 bacteriophage is made up of single stranded DNA and proteins. It's long and thin. So it's 880 nanometers in length, and it's about 9 nanometers in diameter. And so one of the reasons I love it is it spans the nanoscale and almost the micron scale at the same time. Take the single strand DNAs, obviously a model, and you can cut it with molecular scissors. And you can put a new piece of DNA in between. And so you put a small piece of DNA in there that doesn't belong there. And that piece of DNA is going to randomly code for a protein. Now, the next time that that virus is replicated within a bacterial host, it'll be able to put a new protein sequence on the coat, just a short protein sequence on the coat, maybe like 8 or 12 amino acids in length. And just like that abalone is going to grab calcium and build calcium carbonate. We're going to have our viruses build iron phosphate for a battery electrode material or Gallium arsenide or cad sulfide for a semiconductor material.
