dialogue.269:
Explainer: Well I brought a little bit of a prop to explain how chirped pulse amplification works. Our short pulses are made of different colors. So I've got a colored slinky here. We probably could've called it stretched pulse amplification but that's kind of boring so we used the word chirped. The word chirped comes around because birds chirp. When the birds are singing, the notes are actually changing audio frequency with time and that's a chirp. The point is is that when all the light is squeezed together like this, it's a short pulse. And that's when it's a hammer because all of the light is now concentrated and you can imagine if this was coming along and also using a lens to focus it small, then all of that light at the focal spot, concentrate. And so that was the laser hammer. So we can't have that in the laser. So the question is what could we do? The fact that it's different colors and different colors because of dispersion, travel different speeds inside material. So we used a long fiber, 1.4 kilometers of fiber but, in fiber, the red colors really haven't got that much in common with the glass atoms and so they spend very little time interacting and they travel fast. The red is going to start traveling faster than the green, faster than the blue and, as you travel down the fiber, next thing you know, you have a long pulse and it's chirped from red at the beginning to blue at the back. And so the frequencies go hoo! Like this okay? So this is a chirped pulse and now it's a long pulse. And so, first this is what we did, we chirped it, we stretched it, then we can safely amplify it because it's not all concentrated and, after we amplify it, then we use something called a compressor and we put all of the colors back together and it was back being a short pulse but a high energy pulse. And then we really had what I like to call a laser hammer. When this laser pulse goes inside, it smacks those electrons right off the atom.
